export const navLinks = [
  {
    href: "./vehicles",
    label: "VEHICLE",
    products: [
      {
        cover: Nav_S,
        title: "Model S",
        links: [
          { label: "Learn", to: "/model s" },
          { label: "Order", to: "/" },
        ],
      },
      {
        cover: Nav_X,
        title: "Model X",
        links: [
          { label: "Learn", to: "/model x" },
          { label: "Order", to: "/" },
        ],
      },
      {
        cover: Nav_3,
        title: "Model 3",
        links: [
          { label: "Learn", to: "/model 3" },
          { label: "Order", to: "/" },
        ],
      },
      {
        cover: Nav_Y,
        title: "Model Y",
        links: [
          { label: "Learn", to: "/model y" },
          { label: "Order", to: "/" },
        ],
      },
      {
        cover: Nav_Roadster,
        title: "Roadster",
        links: [
          { label: "Learn", to: "/roadster" },
          { label: "Order", to: "/" },
        ],
      },
      {
        cover: Nav_Cybertruck,
        title: "Cybertruck",
        links: [
          { label: "Learn", to: "/cybertruck" },
          { label: "Order", to: "/" },
        ],
      },
      {
        cover: Nav_Semi,
        title: "Semi",
        links: [
          { label: "Learn", to: "/semi" },
          { label: "Order", to: "/" },
        ],
      },
      {
        cover: Nav_HMC,
        title: "Help Me Choose",
        links: [{ label: "Get Started", to: "/help" }],
      },
    ],
    links: [
      { label: "Inventory", to: "/" },
      { label: "Used Cars", to: "/" },
      { label: "Demo Drive", to: "/demo" },
      { label: "Trade-in", to: "/tradein" },
      { label: "Fleet", to: "/fleet" },
    ],
  },
  {
    href: "./energy",
    label: "ENERGY",
    products: [
      {
        cover: Nav_Powerwall,
        title: "Powerwall",
        links: [{ label: "Learn", to: "/powerwall" }],
      },
      {
        cover: Nav_Megapack,
        title: "Megapack",
        links: [{ label: "Learn", to: "/megapack" }],
      },
    ],
    links: [
      { label: "Support", to: "/" },
      { label: "Commercial", to: "/commercial" },
      { label: "Utilities", to: "/utilities" },
    ],
  },
  {
    href: "./charging",
    label: "CHARGING",
    products: [
      {
        cover: Nav_Charging,
        title: "Charging",
        links: [{ label: "Learn", to: "/charging" }],
      },
      {
        cover: Nav_Home_Charging,
        title: "Home Charging",
        links: [
          { label: "Learn", to: "/" },
          { label: "Shop", to: "/" },
        ],
      },
      {
        cover: Nav_Supercharging,
        title: "Supercharging",
        links: [
          { label: "Learn", to: "/" },
          { label: "Find", to: "/" },
        ],
      },
    ],
    links: [
      { label: "Trip Planner", to: "/" },
      { label: "Charging With NACS", to: "/" },
      { label: "Supercharger Voting", to: "/" },
      { label: "Host a Supercharger", to: "/" },
      { label: "Host Wall Connectors", to: "/" },
    ],
  },
  {
    href: "./discover",
    label: "DISCOVER",
    links: [
      {
        title: "Resources",
        links: [
          { label: "Demo Drive", to: "/" },
          { label: "Customer Stories", to: "/" },
          { label: "Events", to: "/" },
        ],
      },
      {
        title: "Location Services",
        links: [
          { label: "Find Us", to: "/" },
          { label: "Trip Planner", to: "/" },
          { label: "Find a Collision Center", to: "/" },
          { label: "Find a Certified Installer", to: "/" },
        ],
      },
      {
        title: "Company",
        links: [
          { label: "About", to: "/" },
          { label: "Careers", to: "/" },
          { label: "Investor Relations", to: "/" },
        ],
      },
    ],
  },
];
